text:
Hey @GovofCO, thanks for your recent letters about the big, ugly, Republican bill and its dangerous impact on Coloradans. 

I agree that this bill would be a disaster for Colorado, which is why I voted against it, along with every other CO House Democrat. 

@HouseDemocrats and I are unified in our opposition to this bill, and we’re fighting every day to stop it so we can protect SNAP recipients, Medicaid beneficiaries, and CO’s clean energy future.
